import React from "react";
import style from "./ErrorModal.module.css";
import Card from "./Card";

const ErrorModal = (props) => {
  return (
    <Card>
      <header>
        <h2></h2>
      </header>
      <div className={style.modal}>
        <p className={style.content}>{props.message}</p>
      </div>
      <footer></footer>
    </Card>
  );
};

export default ErrorModal;
